import pandas as pd
import matplotlib.pyplot as plt
import numpy as np
import statsmodels
from statsmodels.distributions.empirical_distribution import ECDF

"""![image.png](data:image/png;base64,)"""

data1 = [3,12,8,7,9,4,4,8,5,10,2]
data_series = pd.Series(data1)

# Подсчет абсолютных частот
frequency_table = data_series.value_counts().sort_index()
absolute_frequencies = frequency_table

# Подсчет относительных частот
relative_frequencies = frequency_table / len(data1)

frequency_df = pd.DataFrame({
    'Значение': absolute_frequencies.index,
    'Абсолютная частота': absolute_frequencies.values,
    'Относительная частота': relative_frequencies.values
})

print(frequency_df)

"""![image.png](data:image/png;base64,)"""

plt.plot(frequency_df['Значение'], frequency_df['Относительная частота'], marker='o', linestyle='-')

plt.xlabel('Значение')
plt.ylabel('Относительная частота')
plt.title('Полигон относительных частот')
plt.grid(True)
plt.show()

"""![image.png](data:image/png;base64,)

Функцией распределения называют функцию,
определяющую вероятность того, что случайная величина
в результате испытания примет значение, меньшее текущего

![image.png](data:image/png;base64,)
"""

sorted_data = np.sort(data1)

n = len(sorted_data)
ecdf = np.arange(1, n + 1) / n

plt.step(sorted_data, ecdf, where='post', label='ЭФР')
plt.xlabel('Значение')
plt.ylabel('ЭФР')
plt.title('Эмпирическая функция распределения')
plt.grid(True)
plt.legend()
plt.show()

"""![image.png](data:image/png;base64,)"""

print("Выборочное среднее: ", np.mean(data1))

print("Выборочная дисперсия: ", np.var(data1))

print("Выборочное стандартное отклонение: ", np.std(data1))

print("Выборочная медиана: ", np.median(data1))

print("Коэффициент вариации: ", np.std(data1) / np.mean(data1) * 100)

