"""**Вещественнные данные**

![image.png](data:image/png;base64,)

Правило Стерджеса, чтобы определить оптимальное количество бинов для использования в гистограмме.

Число интервалов в гистограмме:![image.png](data:image/png;base64,)

Вычисление границ интервалов: ![image.png](data:image/png;base64,)
"""

data = [1.67,1.75,1.88,1.73,1.70,1.60,1.80,1.80,1.76,1.88,1.84]
n = len(data)
m = int(np.ceil(1 + np.log2(n)))
print("Число интервалов (m) по правилу Стёрджесса: ", m)

data_min, data_max = min(data), max(data)
interval_width = (data_max - data_min) / m
bins = np.arange(data_min, data_max + interval_width, interval_width)
bins = bins[:-1]
print("Границы интервалов:", bins)

"""![image.png](data:image/png;base64,)"""

hist, edges = np.histogram(data, bins=bins)
relative_frequencies = hist / n

#hist — это массив, содержащий абсолютные частоты
#edges — это массив, содержащий границы интервалов

intervals = [f"[{edges[i]:.2f}, {edges[i+1]:.2f})" for i in range(len(edges)-1)]
variation_series_df = pd.DataFrame({'Интервал': intervals,
                                    'Абсолютная частота': hist,
                                    'Относительная частота': relative_frequencies})
print("\nВариационный ряд с частотами:")
print(variation_series_df)


plt.hist(data, bins=bins, weights=np.ones_like(data) / n, edgecolor='black', alpha=0.7)
plt.xlabel('Интервалы')
plt.ylabel('Относительная частота')
plt.title('Гистограмма распределения относительных частот')
plt.grid(True)
plt.show()

"""![image.png](data:image/png;base64,)"""

cumulative_frequencies = np.cumsum(relative_frequencies)#накопленная сумма до текущего индекса (используется для интервалов)

plt.step(edges[:-1], cumulative_frequencies, where='post', label='ЭФР')#post - ступенька справа
plt.xlabel('Значение')
plt.ylabel('Эмпирическая функция распределения')
plt.title('Эмпирическая функция распределения')
plt.grid(True)
plt.legend()
plt.show()

"""![image.png](data:image/png;base64,)"""

mean = np.mean(data)
variance = np.var(data)
std_dev = np.sqrt(variance)
median = np.median(data)
cv = (std_dev / mean) * 100

print(f'Выборочное среднее: {mean:.2f}')
print(f'Выборочная дисперсия: {variance:.2f}')
print(f'Выборочное стандартное отклонение: {std_dev:.2f}')
print(f'Выборочная медиана: {median:.2f}')
print(f'Коэффициент вариации: {cv:.2f}%')